import React, { useState } from 'react';
import './FavoriteIcon.css'; // Adicione o CSS necessário

const FavoriteIcon = ({ isFavorite, onClick }) => {
  return (
    <img
      src={isFavorite ? 'assets/icones/heart/Path_filled.png' : 'assets/icones/heart/Path.png'}
      alt="Favorite"
      className={`favorite-icon ${isFavorite ? 'active' : ''}`}
      onClick={onClick}
    />
  );
};

export default FavoriteIcon;
